INSERT INTO `cms_page` (`page_id`, `title`, `root_template`, `meta_keywords`, `meta_description`, `identifier`, `content_heading`, `content`, `creation_time`, `update_time`, `is_active`, `sort_order`, `layout_update_xml`, `custom_theme`, `custom_root_template`, `custom_layout_update_xml`, `custom_theme_from`, `custom_theme_to`) VALUES
(1, '404 Not Found 1', 'Page_404_Page', 'Page keywords', 'Page description', 'no-route', NULL, '<div id="wrapper">\r\n<div class="w1">\r\n<div class="w2">\r\n<div class="logo-holder">\r\n<div class="container">\r\n<div class="row">\r\n<div class="col col-lg-12 col-md-12 col-sm-12 col-xs-12"><strong class="logo"><a href="#"><img alt="" src="{{media url="wysiwyg/logo404/logo.png"}}" /></a></strong></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="text-area">\r\n<h1>STAY <span>CALM</span> &amp; <br />DONT FREAK OUT !!</h1>\r\n<p>Unfortunately, something cool you are looking for is unavailable. <br />Try visiting our <a class="home" href="#">HOME PAGE</a> and start from there.</p>\r\n<ul class="link-holder">\r\n<li><a class="email" href="mailto:talktous@creoroom.com">talktous@creoroom.com</a></li>\r\n<li><a class="tel" href="tel:+97144355422">T: +971 4 435 5422</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '2015-05-24 07:15:26', '2015-07-02 03:12:08', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'Home page', 'one_column', NULL, NULL, 'home', NULL, '<p>&nbsp;<!-- pagebreak --></p>', '2015-05-24 07:15:26', '2015-07-24 02:59:27', 1, 0, '<!--<reference name="content">\r\n        <block type="catalog/product_new" name="home.catalog.product.new" alias="product_new" template="catalog/product/new.phtml" after="cms_page">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type="reports/product_viewed" name="home.reports.product.viewed" alias="product_viewed" template="reports/home_product_viewed.phtml" after="product_new">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type="reports/product_compared" name="home.reports.product.compared" template="reports/home_product_compared.phtml" after="product_viewed">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n    </reference>\r\n    <reference name="right">\r\n        <action method="unsetChild"><alias>right.reports.product.viewed</alias></action>\r\n        <action method="unsetChild"><alias>right.reports.product.compared</alias></action>\r\n    </reference>-->', NULL, NULL, NULL, NULL, NULL),
