(5, 'Enable Cookies', 'one_column', NULL, NULL, 'enable-cookies', NULL, '<div class="std">\n    <ul class="messages">\n        <li class="notice-msg">\n            <ul>\n                <li>Please enable cookies in your web browser to continue.</li>\n            </ul>\n        </li>\n    </ul>\n    <div class="page-title">\n        <h1><a name="top"></a>What are Cookies?</h1>\n    </div>\n    <p>Cookies are short pieces of data that are sent to your computer when you visit a website.\n    On later visits, this data is then returned to that website. Cookies allow us to recognize you automatically\n    whenever you visit our site so that we can personalize your experience and provide you with better service.\n    We also use cookies (and similar browser data, such as Flash cookies) for fraud prevention and other purposes.\n     If your web browser is set to refuse cookies from our website, you will not be able to complete a purchase\n     or take advantage of certain features of our website, such as storing items in your Shopping Cart or\n     receiving personalized recommendations. As a result, we strongly encourage you to configure your web\n     browser to accept cookies from our website.</p>\n    <h2 class="subtitle">Enabling Cookies</h2>\n    <ul class="disc">\n        <li><a href="#ie7">Internet Explorer 7.x</a></li>\n        <li><a href="#ie6">Internet Explorer 6.x</a></li>\n        <li><a href="#firefox">Mozilla/Firefox</a></li>\n        <li><a href="#opera">Opera 7.x</a></li>\n    </ul>\n    <h3><a name="ie7"></a>Internet Explorer 7.x</h3>\n    <ol>\n        <li>\n            <p>Start Internet Explorer</p>\n        </li>\n        <li>\n            <p>Under the <strong>Tools</strong> menu, click <strong>Internet Options</strong></p>\n            <p><img src="{{skin url="images/cookies/ie7-1.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Privacy</strong> tab</p>\n            <p><img src="{{skin url="images/cookies/ie7-2.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Advanced</strong> button</p>\n            <p><img src="{{skin url="images/cookies/ie7-3.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Put a check mark in the box for <strong>Override Automatic Cookie Handling</strong>,\n            put another check mark in the <strong>Always accept session cookies </strong>box</p>\n            <p><img src="{{skin url="images/cookies/ie7-4.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src="{{skin url="images/cookies/ie7-5.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src="{{skin url="images/cookies/ie7-6.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Restart Internet Explore</p>\n        </li>\n    </ol>\n    <p class="a-top"><a href="#top">Back to Top</a></p>\n    <h3><a name="ie6"></a>Internet Explorer 6.x</h3>\n    <ol>\n        <li>\n            <p>Select <strong>Internet Options</strong> from the Tools menu</p>\n            <p><img src="{{skin url="images/cookies/ie6-1.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> tab</p>\n        </li>\n        <li>\n            <p>Click the <strong>Default</strong> button (or manually slide the bar down to <strong>Medium</strong>)\n            under <strong>Settings</strong>. Click <strong>OK</strong></p>\n            <p><img src="{{skin url="images/cookies/ie6-2.gif"}}" alt="" /></p>\n        </li>\n    </ol>\n    <p class="a-top"><a href="#top">Back to Top</a></p>\n    <h3><a name="firefox"></a>Mozilla/Firefox</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong>-menu in Mozilla</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Options...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection in the left part of the window. (See image below)</p>\n            <p><img src="{{skin url="images/cookies/firefox.png"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Expand the <strong>Cookies</strong> section</p>\n        </li>\n        <li>\n            <p>Check the <strong>Enable cookies</strong> and <strong>Accept cookies normally</strong> checkboxes</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong>.</p>\n        </li>\n    </ol>\n    <p class="a-top"><a href="#top">Back to Top</a></p>\n    <h3><a name="opera"></a>Opera 7.x</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong> menu in Opera</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Preferences...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection near the bottom left of the window. (See image below)</p>\n            <p><img src="{{skin url="images/cookies/opera.png"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>The <strong>Enable cookies</strong> checkbox must be checked, and <strong>Accept all cookies</strong>\n            should be selected in the &quot;<strong>Normal cookies</strong>&quot; drop-down</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong></p>\n        </li>\n    </ol>\n    <p class="a-top"><a href="#top">Back to Top</a></p>\n</div>\n', '2015-05-24 07:15:28', '2015-05-24 07:15:28', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(6, 'Privacy Policy', 'one_column', NULL, NULL, 'privacy-policy-cookie-restriction-mode', 'Privacy Policy', '<p style="color: #ff0000; font-weight: bold; font-size: 13px">\n    Please replace this text with you Privacy Policy.\n    Please add any additional cookies your website uses below (e.g., Google Analytics)\n</p>\n<p>\n    This privacy policy sets out how {{config path="general/store_information/name"}} uses and protects any information\n    that you give {{config path="general/store_information/name"}} when you use this website.\n    {{config path="general/store_information/name"}} is committed to ensuring that your privacy is protected.\n    Should we ask you to provide certain information by which you can be identified when using this website,\n    then you can be assured that it will only be used in accordance with this privacy statement.\n    {{config path="general/store_information/name"}} may change this policy from time to time by updating this page.\n    You should check this page from time to time to ensure that you are happy with any changes.\n</p>\n<h2>What we collect</h2>\n<p>We may collect the following information:</p>\n<ul>\n    <li>name</li>\n    <li>contact information including email address</li>\n    <li>demographic information such as postcode, preferences and interests</li>\n    <li>other information relevant to customer surveys and/or offers</li>\n</ul>\n<p>\n    For the exhaustive list of cookies we collect see the <a href="#list">List of cookies we collect</a> section.\n</p>\n<h2>What we do with the information we gather</h2>\n<p>\n    We require this information to understand your needs and provide you with a better service,\n    and in particular for the following reasons:\n</p>\n<ul>\n    <li>Internal record keeping.</li>\n    <li>We may use the information to improve our products and services.</li>\n    <li>\n        We may periodically send promotional emails about new products, special offers or other information which we\n        think you may find interesting using the email address which you have provided.\n    </li>\n    <li>\n        From time to time, we may also use your information to contact you for market research purposes.\n        We may contact you by email, phone, fax or mail. We may use the information to customise the website\n        according to your interests.\n    </li>\n</ul>\n<h2>Security</h2>\n<p>\n    We are committed to ensuring that your information is secure. In order to prevent unauthorised access or disclosure,\n    we have put in place suitable physical, electronic and managerial procedures to safeguard and secure\n    the information we collect online.\n</p>\n<h2>How we use cookies</h2>\n<p>\n    A cookie is a small file which asks permission to be placed on your computer''s hard drive.\n    Once you agree, the file is added and the cookie helps analyse web traffic or lets you know when you visit\n    a particular site. Cookies allow web applications to respond to you as an individual. The web application\n    can tailor its operations to your needs, likes and dislikes by gathering and remembering information about\n    your preferences.\n</p>\n<p>\n    We use traffic log cookies to identify which pages are being used. This helps us analyse data about web page traffic\n    and improve our website in order to tailor it to customer needs. We only use this information for statistical\n    analysis purposes and then the data is removed from the system.\n</p>\n<p>\n    Overall, cookies help us provide you with a better website, by enabling us to monitor which pages you find useful\n    and which you do not. A cookie in no way gives us access to your computer or any information about you,\n    other than the data you choose to share with us. You can choose to accept or decline cookies.\n    Most web browsers automatically accept cookies, but you can usually modify your browser setting\n    to decline cookies if you prefer. This may prevent you from taking full advantage of the website.\n</p>\n<h2>Links to other websites</h2>\n<p>\n    Our website may contain links to other websites of interest. However, once you have used these links\n    to leave our site, you should note that we do not have any control over that other website.\n    Therefore, we cannot be responsible for the protection and privacy of any information which you provide whilst\n    visiting such sites and such sites are not governed by this privacy statement.\n    You should exercise caution and look at the privacy statement applicable to the website in question.\n</p>\n<h2>Controlling your personal information</h2>\n<p>You may choose to restrict the collection or use of your personal information in the following ways:</p>\n<ul>\n    <li>\n        whenever you are asked to fill in a form on the website, look for the box that you can click to indicate\n        that you do not want the information to be used by anybody for direct marketing purposes\n    </li>\n    <li>\n        if you have previously agreed to us using your personal information for direct marketing purposes,\n        you may change your mind at any time by writing to or emailing us at\n        {{config path="trans_email/ident_general/email"}}\n    </li>\n</ul>\n<p>\n    We will not sell, distribute or lease your personal information to third parties unless we have your permission\n    or are required by law to do so. We may use your personal information to send you promotional information\n    about third parties which we think you may find interesting if you tell us that you wish this to happen.\n</p>\n<p>\n    You may request details of personal information which we hold about you under the Data Protection Act 1998.\n    A small fee will be payable. If you would like a copy of the information held on you please write to\n    {{config path="general/store_information/address"}}.\n</p>\n<p>\n    If you believe that any information we are holding on you is incorrect or incomplete,\n    please write to or email us as soon as possible, at the above address.\n    We will promptly correct any information found to be incorrect.\n</p>\n<h2><a name="list"></a>List of cookies we collect</h2>\n<p>The table below lists the cookies we collect and what information they store.</p>\n<table class="data-table">\n    <thead>\n        <tr>\n            <th>COOKIE name</th>\n            <th>COOKIE Description</th>\n        </tr>\n    </thead>\n    <tbody>\n        <tr>\n            <th>CART</th>\n            <td>The association with your shopping cart.</td>\n        </tr>\n        <tr>\n            <th>CATEGORY_INFO</th>\n            <td>Stores the category info on the page, that allows to display pages more quickly.</td>\n        </tr>\n        <tr>\n            <th>COMPARE</th>\n            <td>The items that you have in the Compare Products list.</td>\n        </tr>\n        <tr>\n            <th>CURRENCY</th>\n            <td>Your preferred currency</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER</th>\n            <td>An encrypted version of your customer id with the store.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_AUTH</th>\n            <td>An indicator if you are currently logged into the store.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_INFO</th>\n            <td>An encrypted version of the customer group you belong to.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_SEGMENT_IDS</th>\n            <td>Stores the Customer Segment ID</td>\n        </tr>\n        <tr>\n            <th>EXTERNAL_NO_CACHE</th>\n            <td>A flag, which indicates whether caching is disabled or not.</td>\n        </tr>\n        <tr>\n            <th>FRONTEND</th>\n            <td>You sesssion ID on the server.</td>\n        </tr>\n        <tr>\n            <th>GUEST-VIEW</th>\n            <td>Allows guests to edit their orders.</td>\n        </tr>\n        <tr>\n            <th>LAST_CATEGORY</th>\n            <td>The last category you visited.</td>\n        </tr>\n        <tr>\n            <th>LAST_PRODUCT</th>\n            <td>The most recent product you have viewed.</td>\n        </tr>\n        <tr>\n            <th>NEWMESSAGE</th>\n            <td>Indicates whether a new message has been received.</td>\n        </tr>\n        <tr>\n            <th>NO_CACHE</th>\n            <td>Indicates whether it is allowed to use cache.</td>\n        </tr>\n        <tr>\n            <th>PERSISTENT_SHOPPING_CART</th>\n            <td>A link to information about your cart and viewing history if you have asked the site.</td>\n        </tr>\n        <tr>\n            <th>POLL</th>\n            <td>The ID of any polls you have recently voted in.</td>\n        </tr>\n        <tr>\n            <th>POLLN</th>\n            <td>Information on what polls you have voted on.</td>\n        </tr>\n        <tr>\n            <th>RECENTLYCOMPARED</th>\n            <td>The items that you have recently compared.            </td>\n        </tr>\n        <tr>\n            <th>STF</th>\n            <td>Information on products you have emailed to friends.</td>\n        </tr>\n        <tr>\n            <th>STORE</th>\n            <td>The store view or language you have selected.</td>\n        </tr>\n        <tr>\n            <th>USER_ALLOWED_SAVE_COOKIE</th>\n            <td>Indicates whether a customer allowed to use cookies.</td>\n        </tr>\n        <tr>\n            <th>VIEWED_PRODUCT_IDS</th>\n            <td>The products that you have recently viewed.</td>\n        </tr>\n        <tr>\n            <th>WISHLIST</th>\n            <td>An encrypted list of products added to your Wishlist.</td>\n        </tr>\n        <tr>\n            <th>WISHLIST_CNT</th>\n            <td>The number of items in your Wishlist.</td>\n        </tr>\n    </tbody>\n</table>', '2015-05-24 07:15:28', '2015-05-24 07:15:28', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(7, 'FAQ', 'one_column', NULL, NULL, 'faq', 'FAQ', '<div class="row">\r\n<div class="faq-area col col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<h3><span>HOW TO SHOP</span></h3>\r\n<ul class="faq-frame">\r\n<li class="open-close2 active">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>Do I need to set up an account to place an order?</span></a></div>\r\n<div class="slide" style="display: block;">\r\n<p>No, you can shop at Miella.com without creating an account. We actually have two options so you can checkout as either a Guest or a Member. However, by creating an account you would get the following benefits:</p>\r\n<ul class="list">\r\n<li>Review your order history,</li>\r\n<li>Save your favorite products and organize them into your wishlist,</li>\r\n<li>Save your address to make it a lot easier to shop in the future.</li>\r\n</ul>\r\n</div>\r\n</li>\r\n<li class="open-close2 active">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>Is my personal information kept private?</span></a></div>\r\n<div class="slide" style="display: block;">\r\n<p>Absolutely! We take this responsibility very seriously, so rest assured, your personal information is kept private and confidential, and at no point will we share it with any third party. Please read our Privacy Policy for full details.</p>\r\n</div>\r\n</li>\r\n<li class="open-close2 active">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>I forgot my password what do I do now?</span></a></div>\r\n<div class="slide">\r\n<p>Don&rsquo;t worry, we can reset your password. Just click on the Forgot Password link and follow the instructions when prompted to Login. For security reasons, we will never email you your old password.</p>\r\n</div>\r\n</li>\r\n<li class="open-close2 active">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>How can I pay?</span></a></div>\r\n<div class="slide" style="display: block;">\r\n<p>We accept all leading credit cards including Mastercard, and Visa. We also offer Cash On Delivery (COD) services as an alternative to hassle free shopping. Please note that Cash On Delivery is only available in selected locations.</p>\r\n</div>\r\n</li>\r\n<li class="open-close2 active">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>Why has my payment been declined?</span></a></div>\r\n<div class="slide">\r\n<p>IIf your payment has been declined, the card details in your account may not match the details held by your bank or card provider. Please check the following information on your payment details:</p>\r\n<ul class="list">\r\n<li>Have you entered the correct expiry date?</li>\r\n<li>Does the billing address and postcode you entered match the details held by your card provider?</li>\r\n<li>Do you have sufficient funds available on the card?</li>\r\n</ul>\r\n</div>\r\n</li>\r\n<li class="open-close2 active">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>How do I track my orders?</span></a></div>\r\n<div class="slide">\r\n<p>IIf your payment has been declined, the card details in your account may not match the details held by your bank or card provider. Please check the following information on your payment details:</p>\r\n<ul class="list">\r\n<li>Have you entered the correct expiry date?</li>\r\n<li>Does the billing address and postcode you entered match the details held by your card provider?</li>\r\n<li>Do you have sufficient funds available on the card?</li>\r\n</ul>\r\n</div>\r\n</li>\r\n<li class="open-close2 active">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>I received my item and it has been damaged, what do I do?</span></a></div>\r\n<div class="slide">\r\n<p>We are sorry that your order had a damaged item. We do our best to ensure that all products are checked prior to shipment. Please accept our apologies for any inconvenience this may have caused you. Kindly note that if your order has been received damaged, we request that you report this upon arrival of your order and notify us immediately (within a maximum of 2 days) through any of our Contact Us options. We may ask you for pictures in order to assess the damage and arrange for a full refund. If you used cash on delivery as a payment option, we will send our courier service provider to personally hand over the cash and collect the item within 3 working days. If you paid for the item with a credit card then a full refund will be credited to the card used for the purchase within a period of 20 days (depending on your bank) and our courier service agent will then collect the item within 3 working days.</p>\r\n</div>\r\n</li>\r\n</ul>\r\n<h3><span>HOW CAN I SIGN-UP FOR A NEWSLETTER OR UNSUBSCRIBE?</span></h3>\r\n<ul class="faq-frame">\r\n<li class="open-close2">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>How can I sign-up?</span></a></div>\r\n<div class="slide js-slide-hidden" style="display: none;">\r\n<p>It&rsquo;s simple. We have a newsletter sign-up at the bottom of each page, so you can leave your email address and we will ensure you get information on the latest collections and upcoming activities at Miella.</p>\r\n</div>\r\n</li>\r\n<li class="open-close2">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>How can I unsubscribe?</span></a></div>\r\n<div class="slide js-slide-hidden" style="display: none;">\r\n<p>Lorem Ipsum ...</p>\r\n</div>\r\n</li>\r\n<li class="open-close2">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>Return and Exchange</span></a></div>\r\n<div class="slide js-slide-hidden" style="display: none;">\r\n<p>Lorem Ipsum ...</p>\r\n</div>\r\n</li>\r\n</ul>\r\n<h3><span>SHIPPING</span></h3>\r\n<ul class="faq-frame">\r\n<li class="open-close2">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>How do deliveries work?</span></a></div>\r\n<div class="slide js-slide-hidden">\r\n<p>Lorem Ipsum ...</p>\r\n</div>\r\n</li>\r\n<li class="open-close2">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>How much do I have to pay for delivery?</span></a></div>\r\n<div class="slide js-slide-hidden">\r\n<p>Lorem Ipsum ...</p>\r\n</div>\r\n</li>\r\n<li class="open-close2">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>How long will my delivery take to be received?</span></a></div>\r\n<div class="slide js-slide-hidden">\r\n<p>Lorem Ipsum ...</p>\r\n</div>\r\n</li>\r\n<li class="open-close2">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>Where do you deliver?</span></a></div>\r\n<div class="slide js-slide-hidden">\r\n<p>Lorem Ipsum ...</p>\r\n</div>\r\n</li>\r\n<li class="open-close2">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>How does my order get processed if I want to pay cash on delivery?</span></a></div>\r\n<div class="slide js-slide-hidden">\r\n<p>Lorem Ipsum ...</p>\r\n</div>\r\n</li>\r\n<li class="open-close2">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>How can I track my order? </span></a></div>\r\n<div class="slide js-slide-hidden">\r\n<p>Lorem Ipsum ...</p>\r\n</div>\r\n</li>\r\n</ul>\r\n<h3><span>SIZE GUIDE</span></h3>\r\n<ul class="faq-frame">\r\n<li class="open-close2">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>Which size should I choose?</span></a></div>\r\n<div class="slide js-slide-hidden">\r\n<p>Lorem Ipsum ...</p>\r\n</div>\r\n</li>\r\n<li class="open-close2">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>How do the sizes fit?</span></a></div>\r\n<div class="slide js-slide-hidden">\r\n<p>Lorem Ipsum ...</p>\r\n</div>\r\n</li>\r\n<li class="open-close2">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>How do I know which size to choose?tt</span></a></div>\r\n<div class="slide js-slide-hidden">\r\n<p>Lorem Ipsum ...</p>\r\n</div>\r\n</li>\r\n<li class="open-close2">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>Does a difference of one inch/cm mean that the item won''t fit me?</span></a></div>\r\n<div class="slide js-slide-hidden">\r\n<p>Lorem Ipsum ...</p>\r\n</div>\r\n</li>\r\n<li class="open-close2">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>Why does my item look so large/small?</span></a></div>\r\n<div class="slide js-slide-hidden">\r\n<p>Lorem Ipsum ...</p>\r\n</div>\r\n</li>\r\n<li class="open-close2">\r\n<div class="openeer-holder"><a class="opener arrow" href="#">.</a> <a class="opener question" href="#"><span>Are the items I buy guaranteed to have the exact dimensions as shown online?</span></a></div>\r\n<div class="slide js-slide-hidden">\r\n<p>Lorem Ipsum ...</p>\r\n</div>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>', '2015-06-26 06:28:33', '2015-07-01 02:13:21', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(8, 'Shipping Method', 'one_column', NULL, NULL, 'shipping-method', NULL, '<div class="row">\r\n						<div class="col col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n							<h2>Shipping</h2>\r\n						</div>\r\n					</div>\r\n					<div class="row">\r\n						<div class="shipping-methods col col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n							<div class="text-holder">\r\n								<h3><span>How do deliveries work?</span></h3>\r\n								<p>We deliver in the UAE and work with various courier companies such as Aramex and Speedex to ensure timely deliveries. Deliveries and timelines will vary depending on where you live in the UAE.</p>\r\n								<p>You can contact us on <a href="tel:+9714 5579810">+9714 5579810</a> or email us at <a href="mailto:help@creo.com">help@creo.com</a> anytime from <strong>Sunday to Thursday, 9am to 6pm</strong> for inquiries about delivery times.</p>\r\n							</div>\r\n							<div class="text-holder">\r\n								<h3><span>How much do I have to pay? for delivery?</span></h3>\r\n								<p>Nothing during special campaigns that we run throughout the year and also for all orders of 150dhs and above. For orders less than 150dhs the delivery charges will be calculated upon check-out.</p>\r\n							</div>\r\n							<div class="text-holder">\r\n								<h3><span>How long will my delivery take to be received?</span></h3>\r\n								<p>Our courier partners try very hard to deliver most orders for the UAE within the next day, Saturday through Thursday.</p>\r\n							</div>\r\n							<div class="text-holder">\r\n								<h3><span>Where do you deliver?</span></h3>\r\n								<p>We deliver across the UAE. This includes Dubai, Abu Dhabi, Al Ain, Sharjah, Ajman, Um Al Quwain, Ras Al Khaimah and Fujairah. City limits apply, which means that unfortunately our courier partners can''t deliver everywhere, but we will do our best to accommodate you. We are also working very hard on delivering to the rest of the GCC and worldwide very soon.</p>\r\n							</div>\r\n							<div class="text-holder">\r\n								<h3><span>How does my order get processed if I want to pay cash on delivery?</span></h3>\r\n								<p>At checkout, you can select this payment option. An accurate value of your total payment is calculated and provided at the time of check out. You can then hand over the cash at the time of delivery.</p>\r\n							</div>\r\n							<div class="text-holder">\r\n								<h3><span>How can I get a status update on my order?</span></h3>\r\n								<p>This feature is only available if you are a member (Sorry :). If you are, please follow the steps below:</p>\r\n								<ul>\r\n									<li>1. Find the status of your order by logging into your account and viewing your order history. This will display outstanding and previous orders. You can then click on your order to view it.</li>\r\n									<li>2. Please check your email to see whether you have received a dispatch confirmation.</li>\r\n								</ul>\r\n								<p>You can also drop us an email anytime with your order number at <a href="mailto:help@creo.com">help@creo.com</a>, or you can call us on <a href="tel:+9714 5579810">+9714 5579810</a> from <strong>Sunday to Thursday, 9am to 6pm</strong>.</p>\r\n							</div>\r\n						</div>\r\n					</div>', '2015-06-26 06:30:29', '2015-06-26 06:30:29', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(9, 'contactus', 'one_column', NULL, NULL, 'contactus', NULL, '<div class="row">\r\n<div class="col col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<h2>Contact Us</h2>\r\n</div>\r\n</div>\r\n<div class="row">\r\n<div class="three-column col col-lg-12 col-md-12 col-sm-12 col-xs-12">\r\n<div class="column">\r\n<h3><span>EMAIL</span></h3>\r\n<p>If you have any queries kindly take a look at our list of <a href="#">Frequently Asked Questions</a> which will tell you how to use our site, order from creo.com, start an account and track the progress of your order. If you cannot find the answer to your question, please email our customer service team on <a href="mailto:help@creo.com">help@creo.com</a>, or call us on <a href="tel:+97145579810">+9714 5579810</a>. If you have a question about shopping with us, or about an order you have already placed, please get in touch with us through any of the ways listed below.</p>\r\n<div class="btn-frame"><a class="left" href="#"><span class="span1"><span class="span2">FAQ</span></span></a> <a class="right" href="#"><span class="span1"><span class="span2">Call</span></span> </a><a class="center" href="#"><span>Send Email</span></a></div>\r\n</div>\r\n<div class="column">\r\n<h3><span>TELEPHONE</span></h3>\r\n<p>You can call our Customer Service team on <a href="tel:+97145579810">+9714 5579810</a> anytime from Sunday to Thursday, 9am to 6pm.</p>\r\n<div class="btn-area"><a href="tel:+97145579810">Call</a></div>\r\n<h3><span>WRITE</span></h3>\r\n<p>Feel free to write to us at the office address below:</p>\r\n<address>CREO Customer Service, <br />Grosvenor Business Tower <br />Dubai TECOM, P.O. Box 282945, <br />Dubai, UAE</address></div>\r\n<div class="column large">\r\n<h3><span>FEEDBACK</span></h3>\r\n<p>Help us help you! If there is anything you can&rsquo;t find in our collections and would like us to offer it, please let us know. We are always looking for ways to improve our offering and would love to hear from you. Comments on our service and new ideas to make your experience with us even better, are always welcome. Email us on <a href="mailto:info@creo.com">info@creo.com</a>.</p>\r\n<div class="btn-area"><a href="mailto:info@creo.com">Send Mail</a></div>\r\n</div>\r\n</div>\r\n</div>', '2015-06-26 10:33:35', '2015-06-26 10:33:35', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
